import React, { useState } from 'react';

const EditUser = ({ onSave }) => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSave = () => {
    // Aquí podrías realizar validaciones adicionales si es necesario
    onSave({ username, password });
    setUsername(''); // Limpiar el estado después de guardar
    setPassword('');
  };

  return (
    <div>
      <h2>Create User</h2>
      <input type="text" placeholder="New Username" value={username} onChange={(e) => setUsername(e.target.value)} />
      <input type="password" placeholder="New Password" value={password} onChange={(e) => setPassword(e.target.value)} />
      <button onClick={handleSave}>Save</button>
    </div>
  );
};

export default CreateUser;
